        if i in count_y:
            count_y[i] += 1
        else:
            count_y[i] = 1

    # Find the divisor of x and y with the highest count
    max_count = max(count_x, key=count_x.get)
    max_count = max(count_y, key=count_y.get)

    # Check if max_count is the same as the number of divisors of x and y
    if max_count == n:
