    if len(s) < k:
        return "-1"

    seen = set()
    min_cost = float('inf')

    def dp(i, t):
        nonlocal seen, min_cost

        if i == len(s):
            min_cost = min(min_cost, sum(t))
            return

        for j in range(i, len(s)):
            if t[j] not in seen:
                seen.add(t[j])
                cost = dp(i + 1, t[:j] + [t[j]]) + dp(i + 1, t[j + 1:])
                if j == i:
                    min_cost = min(min_cost, cost)
                else:
                    min_cost = min(min_cost, cost, dp(i, t[:j] + [t[j]]))
                    min_cost = min(min_cost, cost, dp(i, t[j + 1:] + [t[j]]))
            seen.remove(t[j])

    dp(0, [s[:k]])
    return str(min_cost)

