        # Recursively count the number of spaces around the current position
        return 1 + count_spaces(map, row - 1, col, count + 1) + \
               count_spaces(map, row, col - 1, count + 1) + \
               count_spaces(map, row - 1, col - 1, count + 1) + \
               count_spaces(map, row + 1, col - 1, count + 1) + \
               count_spaces(map, row - 1, col + 1, count + 1) + \
               count_spaces(map, row + 1, col + 1, count + 1)

