    count = 0

    # Iterate through each position on the map
    for row in range(R):
        for col in range(C):
            # Check if the position is a free parking space
            if map[row][col] == '.':
                count += 1

    # Count the number of spaces for each parking space and the total number of spaces
    result = count_spaces(map, R - 1, C - 1, 0)
    result += count_spaces(map, R - 1, 0, 0)
    result += count_spaces(map, 0, C - 1, 0)
    result += count_spaces(map, 0, 0, 0)
    result += count_spaces(map, R - 1, C - 1, 0)
    result += count_spaces(map, R - 1, 0, 0)
