        return [polynomial * x**n * (n - x)**2 for x in range(1, n + 1)]

    def minimal_order_polynomial(polynomial, n):
        return polynomial * (polynomial - 1) * (polynomial - 2) / 6

    def polynomial_derivative(polynomial, degree):
        polynomial_derivative = [polynomial]
        for _ in range(degree - 1):
            polynomial_derivative.append(polynomial * polynomial_derivative[-1])
            polynomial_derivative.append(polynomial * polynomial_derivative[-1])
        return polynomial_derivative

    def minimal_order_polynomial_derivative(polynomial, degree):
        return polynomial_derivative(minimal_order_polynomial(polynomial, degree), degree - 1)

    def finite_difference_derivative(polynomial, degree, order):
        finite_difference = []
        for _ in range(order + 1):
            derivative = derivative(polynomial, degree)
            second_derivative = second_derivative(polynomial, degree)
            minimal_order_derivative = minimal_order_polynomial_derivative(polynomial, degree)
            finite_difference.append(sum(derivative) - sum(second_derivative) + sum(minimal_order_derivative))
        return finite_difference

