    def area(a, b, c, d):
        return abs(a * (b + c) * (d + a + b + c) // 2 - b * b - c * c + a * a)

    def enlarge_or_shrink(x, y, edges):
        def shrink(x, y):
            def normalize(x, y):
                return (x - min(x, y)) / (max(x, y) - min(x, y))

            for i in range(len(edges)):
                e = edges[i]
                e[0], e[1] = normalize(e[0], e[1]), normalize(e[1], e[0])
                e[2] += 100
                e[3] += 100
            return x, y

        def grow(x, y):
            def normalize(x, y):
                return (x - min(x, y)) / (max(x, y) - min(x, y))

            for i in range(len(edges)):
                e = edges[i]
                e[0], e[1] = normalize(e[0], e[1]), normalize(e[1], e[0])
                e[2] -= 100
                e[3] -= 100
            return x, y

        if x >= 0 and y >= 0:
            return grow(x, y)
        elif x < 0 and y >= 0:
            return shrink(x, y)
        else:
            return grow(x, y)

    def draw(x, y, edges):
        for edge in edges:
            a, b, c, d = edge
            if (c - a) * (d - b) > 0:
                x1, y1 = a, b
                x2, y2 = c, d
                x = x1 + (y1 - y2) * ((x - y1) / (y2 - y1))
                y = y1 + (x1 - x2) * ((x - y1) / (y2 - y1))
                break

    for _ in range(N):
        edges = [(x, y) for x, y in edges]
        edges = [(x, y) for x, y in edges if x > 0 and y > 0]
        draw(*enlarge_or_shrink(*edges[0], edges[1]))
        edges = [(x, y) for x, y in edges if x < 0 and y >= 0]
        draw(*enlarge_or_shrink(*edges[0], edges[1]))
        edges = [(x, y) for x, y in edges if x >= 0 and y < 0]
        draw(*enlarge_or_shrink(*edges[0], edges[1]))

    return '\n'.join([f'{x:.4f} {y:.4f}' for x, y in edges])

