            col = i%5
            left = key_table[row][col]
            right = key_table[row][col + 1] if col + 1 < 5 else key_table[row + 1][0]
            up = key_table[row + 1][col]
            down = key_table[row + 1][col + 1] if col + 1 < 5 else key_table[row][0]

            # Replace the letters with the encrypted pairs
            if left == right:
                encrypted_text += chr(left + ord('X'))
            elif left == up:
